import './App.css';
import Header from './components/Header';
import Footer from './components/Footer';

const App = () => {

  return (
    <>
      <Header/>
      <div className="TodoBox">
        <div className="input">
          <input type="text"
           placeholder="Write Your Note" 
           id="note" 
           name="note" 
           value="note" />
           <button className="addBtn"> + </button>
        </div>
      </div>
      <div className="TodoItem">
          <ul>
            <li>
              Mango
            </li>
          </ul>
      </div>
      <Footer/>
      </>
  );
}

export default App;
